INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'AFTER', 100, 'CVX_ENH', 'IF n_is_active = ''Y'' THEN ue_ct_dq_rules_pkg.validate_dynamic_sql (n_rule_id); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'BEFORE', 10, 'CVX_ENH', 'IF TRIM(N_OBJECT_ID_SOURCE) IS NULL THEN N_OBJECT_ID_SOURCE := ''OBJECT_ID''; ELSE N_OBJECT_ID_SOURCE := UPPER(N_OBJECT_ID_SOURCE); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'BEFORE', 20, 'CVX_ENH', 'IF TRIM(N_DAYTIME_SOURCE) IS NULL THEN N_DAYTIME_SOURCE := ''DAYTIME''; ELSE N_DAYTIME_SOURCE := UPPER(N_DAYTIME_SOURCE); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'BEFORE', 30, 'CVX_ENH', 'IF TRIM(N_ALT_UNIQUE_KEY_SOURCE) IS NULL THEN N_ALT_UNIQUE_KEY_SOURCE := ''NULL''; ELSE N_ALT_UNIQUE_KEY_SOURCE := UPPER(N_ALT_UNIQUE_KEY_SOURCE); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'BEFORE', 40, 'CVX_ENH', 'IF TRIM(N_FROM_SQL) IS NOT NULL THEN N_FROM_SQL := UPPER(N_FROM_SQL); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'BEFORE', 50, 'CVX_ENH', 'IF n_logging_level is NULL THEN BEGIN SELECT CODE INTO N_LOGGING_LEVEL FROM TV_EC_CODES WHERE CODE_TYPE = ''CT_DQ_LOGGING_LEVEL'' AND IS_DEFAULT = ''Y''; EXCEPTION WHEN no_data_found THEN NULL; WHEN too_many_rows THEN n_logging_level := NULL;END; END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE', 'INSERTING OR UPDATING', 'BEFORE', 60, 'CVX_ENH', 'N_FROM_SQL := REPLACE(N_FROM_SQL,'';'','''');');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE_GROUP', 'INSERTING OR UPDATING', 'BEFORE', 51, 'CVX_ENH', 'IF nvl(n_is_report_only,''N'') = ''N''  and n_start_date_source is NULL THEN Raise_Application_Error(-20910,''From Date Source Required''); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE_GROUP', 'INSERTING OR UPDATING', 'BEFORE', 52, 'CVX_ENH', 'IF nvl(n_is_report_only,''N'') = ''N''  and n_end_date_source is NULL THEN Raise_Application_Error(-20911,''To Date Source Required''); END IF;');
INSERT INTO CLASS_TRIGGER_ACTN_CNFG (CLASS_NAME, TRIGGERING_EVENT, TRIGGER_TYPE, SORT_ORDER, APP_SPACE_CNTX, DB_SQL_SYNTAX) VALUES ('CT_DQ_RULE_GROUP', 'INSERTING OR UPDATING', 'BEFORE', 53, 'CVX_ENH', 'IF nvl(n_is_report_only,''N'') = ''Y''  and n_start_date_source is not NULL THEN Raise_Application_Error(-20912,''From Date Source Not Allowed''); END IF;');
